INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, "2019/07/31 12:00:00", 10021, 4, 24015, 110501, 0.0, 4, "カオリ（サマー）", 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 4.0, "2019/07/31 12:00:00", 10021, 1, 24016, 110501, 0.0, 4, "カオリ（サマー）", 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, "2019/07/31 12:00:00", 10021, 4, 24017, 110501, 0.0, 4, "カオリ（サマー）", 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 5.2, "2019/07/31 12:00:00", 10021, 2, 24018, 110501, 0.0, 1, "カオリ（サマー）", 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 4.2, "2019/07/31 12:00:00", 10021, 6, 24019, 110501, 0.0, 5, "カオリ（サマー）", 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, "2019/07/31 12:00:00", 10021, 2, 24020, 110501, 0.0, 2, "カオリ（サマー）", 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 6.4, "2019/07/31 12:00:00", 10021, 6, 24021, 110501, 0.0, 1, "カオリ（サマー）", 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, "2019/07/31 12:00:00", 10021, 2, 24022, 110501, 0.0, 2, "カオリ（サマー）", 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 10.08, "2019/07/31 12:00:00", 10021, 3, 24023, 110501, 0.0, 6, "カオリ（サマー）", 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 5.0, "2019/07/31 12:00:00", 10021, 2, 24024, 110501, 0.0, 1, "カオリ（サマー）", 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("2030/12/17 14:59:59", 0.0, 0.0, "2019/07/31 12:00:00", 10021, 2, 24025, 110501, 0.0, 2, "カオリ（サマー）", 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11);
